import React from 'react'

export default class Range extends React.Component {
  constructor(props) {
    super(props)
    this.onChange = this.onChange.bind(this)
    this.state = {
      from: undefined,
      to: undefined
    }
  }

  onChange(e) {
    const newState = {}
    newState[e.target.name] = e.target.value
    this.setState(newState)
  }

  render() {
    return (
      <div>
        <input type="number" className="input is-primary is-rounded"
              placeholder="From" name="from" onChange={this.onChange}/>
        <input type="number" className="input is-primary is-rounded"
              placeholder="To" name="to" onChange={this.onChange}/>
        <button className="button is-info is-rounded" style={{width: "100%"}}>Apply</button>
      </div>
    )
  }
}
